“IAM connect” mobile application is created by the Municipal Affairs Bureau (IAM) of the Government of Macao Special Administrative Region. It mainly offers case report, electronic municipal services, Friends of IAM electronic membership cards, push notification service and other functions.

The content includes:
1. Case report: The public may give their opinions through the application. The dedicated department receives and distributes the cases immediately. Enquiries about the progress or follow-up results of cases can be made via the application;
2. Electronic municipal services: The electronic services of IAM are centralised, including guided tour service, guides on administrative formalities of municipal services, ticket-taking and bookings for IAM services, etc.;
3. Friends of IAM electronic membership card: Friends of IAM members can bind their membership cards in the application and use the facilities in activity centres with the electronic membership cards;
4. Push notification service: Users can receive the latest information about IAM.

Aqara Home is an app for smart home automation and control. With Aqara Home, you can:

1. control Aqara accessories anywhere and anytime where there is Internet access;

2. create homes and rooms and assign accessories to the rooms;

3. control your Aqara accessories and check the status of connected appliances. For example:
    *adjust the brightness of lights and check the power consumption of home appliances;
    *monitor the temperature, humidity and air pressure;
    *detect water leak, and human movement;

4. create Automations to automate your home. For example:
     *set a timer to turn on or off an appliance connected to a smart plug;
     *use a Door and Window Sensor to trigger lights: turn on lights automatically when the door opens;

5. create Scenes to control multiple accessories. For example, add a Scene to turn on multiple lights and fans; 

6. ask Siri to control HomeKit supported Aqara accessories and user defined Scenes; Aqara Home app supports following Aqara accessories: Aqara Hub, Smart Plug, Wireless Remote Switch, LED Light Bulb, Door and Window Sensor, Motion Sensor, Temperature and Humidity Sensor, Vibration Sensor, and Water Leak Sensor.  Please see www.aqara.com for more details.

簡介

「來,跟隨我!」(谷 1:17)

天主教香港教區定了2011 年為教友年, 目的是鼓勵教友跟隨天主的腳踪, 將福音傳到地極。作為天主子民, 教會的一份子, 當義不容辭以行動去回應。「天主教教友禮儀小百科」就是在這背景下完成, 希望各位教友都能藉著這免費軟件, 透過教會禮儀的參與、聖經金句的反思和實用資料的應用, 讓各人知道每時每刻每月每年, 我都是教友!,

內容

「天主教教友禮儀小百科」專為教友和其他有興趣了解天主教人士而設,是第一個同類開發和會持續更新的應用程式, 內容廣泛:

● 聖經金句句句甘;

● 禮儀年曆;

● 主日彌撒當日讀經及福音;

● 彌撒常用經文、日用經文;

● 教會節日、慶日和紀念日;

● 聖人生平資料;

● 頌恩歌集;

● 日課經;

● 香港已回天鄉神職人員生平簡介(先賢錄);

● 聖堂、彌撒中心資訊;

● 香港天主教教區機構名錄;

● 靜修及活動場所資料;

● 各大醫院專職服務及牧靈部資訊;

● 教會聖事簡編暨祝福經文;

